name: sharp_stylianos
services:
  snippet-box:
    cpu_shares: 90
    command: []
    container_name: snippet-box
    deploy:
      resources:
        limits:
          memory: 15891M
    image: pawelmalak/snippet-box:latest
    labels:
      icon: data:image/jpeg;base64,
    ports:
      - target: 5000
        published: "5000"
        protocol: tcp
    restart: unless-stopped
    volumes:
      - type: bind
        source: /DATA/AppData/snippet-box
        target: /app/data
    devices: []
    cap_add: []
    environment: []
    network_mode: bridge
    privileged: false
x-casaos:
  author: self
  category: self
  hostname: snip.deleven.net/
  icon: https://raw.githubusercontent.com/pawelmalak/unraid-templates/master/templates/icons/snippet-box.png
  index: /
  port_map: ""
  scheme: https
  store_app_id: sharp_stylianos
  title:
    custom: Snippet-Box
